import React from 'react';

const cafe = (props) => {

    return (
        <tr>
            <th scope="row">{props.id}</th>
            <td>{props.nombre}</td>
            <td>{props.tipo}</td>
            <td>{props.region}</td>

        </tr>
    );

}

export default cafe;
